import React, { useState } from 'react'
import Navbar from './Navbar'
import "./Puzzle.css"
import PuzzuleGame from './PuzzuleGame';
const Puzzle = () => {

  const [input, setInput] = useState('')
  const [message, setMessage] = useState('')
  const [randomNum, setRandomNum] = useState(null)
  const dragItem = useRef();
  const dragOverItem = useRef();
  let val = (input * input)
  const isAscending = (array) => array !== '' ? array?.map((a, i) => a > array[i + 1]).indexOf(true) === -1 : ''
  function handler(e) {
    e.preventDefault()
    if (input === '') {
      return
    } else {
      let random = []
      for (let i = 0; i < val; i++) {
        random.push(i + 1)
      }
      let newArr = random.sort(() => Math.random() - 0.5)
      setRandomNum([...newArr])
    }
  }
  useEffect(() => {
    if (input <= 1 || input === '') {
      setRandomNum(null)
      setMessage('')
    }
  }, [input])

  useEffect(() => {
    if (isAscending(randomNum) !== true) {
      return
    } else {
      setMessage('welcome to the team')
      setRandomNum(null)
      setTimeout(() => {
        alert('welcome to the team')
      }, 300)
    }
  }, [randomNum])

  function handleDragStart(e, position) {
    dragItem.current = position;
  }
  function handleDragEnter(e, position) {
    dragOverItem.current = position;
  }

  function handleDrop() {
    const copyListItems = [...randomNum];
    const dragItemContent = copyListItems[dragItem.current];
    copyListItems.splice(dragItem.current, 1);
    copyListItems.splice(dragOverItem.current, 0, dragItemContent);
    dragItem.current = null;
    dragOverItem.current = null;
    setRandomNum(copyListItems);
  }

  return (
    <>
      <Navbar />
     {/* <SortableList/> */}  {/* <PuzzuleGame/> */}
       <div className="  w-full h-screen pt-10 pb-3 z-50 justify-center items-center">
        <form className="   bg-zinc-300 w-full h-screen ">
          <div className="p-3 w-full mt-8 h-7   justify-center items-center ">
            <h3 className="Main-form-title"> Grid Generator</h3>
            <div class="container">
              <form onSubmit={handler} >
                <div class="form-group  justify-center items-center">
                  <label for="inputNumber">Enter a number:</label>
                  <input class="form-control"
                   type="number" min={1} value={input} onChange={(e) => {
                    setInput('')
                    if (e.target.value < 6) {
                      setInput(e.target.value)
                    }
                  }} 
                  />
                   <input className="btn" type="submit" value="submit" />
                </div>
              </form>

              <div
                // style={{ gridTemplateColumns: `repeat(${size}, 1fr)` }}
                // className={`gridSelected grid rounded-xl  grid-cols-${size} grid-rows-${size} shadow-4xl  w-full  justify-items-center gap-4   mx-auto p-6`}
              >
                <div>
                  {grid.map((row, i) => (
                    <div
                      draggable
                      onDrop={handleDrop}
                      onDragStart={(event,x)=>handleDragStart(event,x)}
                      onDrag={handleDrag}
                      onDragEnd={handleDragEnd}
                      className='grid-row'
                      key={i}>
                      {row.map((cell, j) => (
                        <span className='grid-col'
                          draggable
                          onDrop={handleDrop}
                          onDragStart={handleDragStart}
                          onDrag={handleDrag}
                          onDragEnd={handleDragEnd}
                          key={j}>{cell}</span>
                      ))}
                    </div>
                  ))}
                </div>
                <div class="modal  bg-zinc-400 pt-10 pb-3 z-50 flex-col  w-full h-screen justify-center items-center opacity-90  absolute top-0 bottom-0 right-0  left-0 border border-zinc-600">
                  <p class="text-xl text-zinc-900 font-bold pb-10 z-50">You solved this puzzle</p></div>
              </div>

            </div>
          </div>
        </form>
      </div> 

      {/* 
      ********************************** */}
      {/* <div className="container">
      <h1>Random Grid Puzzle</h1>
      <div className="input-container">
        <label className="input-label">
          Grid Size:
          <input className="input-field" type="number" value={size} onChange={handleSizeChange} />
        </label>
        <button className="generate-button" onClick={handleGenerateClick}>Generate</button>
      </div>
    </div> */}
    </>


  )
}

export default Puzzle
